records.addlTxt:
Defendant Joseph S Duke in court with attorney Alexis Ray Liggins.  Kimberly Dorice Schoepp appeared for the State of Wisconsin.  Plea hearing proceeds.  Count 2 dismissed as a matter of law.  

AS TO COUNT 01:
Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty of OWI - 5th as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms. Court further advised defendant of voting ineligibility.  

 Sentencing proceeded.  Statements by the State, defense and defendant. The Court imposed the following sentence:

Defendant's TOTAL LENGTH OF SENTENCE shall be 33 months.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 15  months.  Defendant shall serve 18 months on EXTENDED SUPERVISION. The defendant IS eligible for the Challenge Incarceration Program and the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

 * Court ordered defendant to provide a DNA sample if not previously given.
 * Court ordered ignitition interlock and driver's license revocation for 32 months.
 * Court ordered defendant to pay a $1200.00 fine, plus DNA surcharge, plus costs and disbursements, from prison funds not to exceed 25%.  Balance to be paid while on extended supervision.
 * Court ordered defendant to complete a driver assessment and safety plan; order signed and filed; copy provided to defendant.

CONDITIONS OF EXTENDED SUPERVISION:
  - No driving whatsoever without a valid license;
 - No controlled substances or alcohol;
 - AODA assessment and treatment;
 - Urine screens;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Parenting classes;
 - Cognitive thinking intervention counseling;
 - Pay balance remaining of all fines, costs and disbursements.  Failure to pay amounts in full would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy.

